import { Button, Container } from 'reactstrap';

const Home = () => {
    return ( <
        div >
        <
        AppNavbar / >
        <
        Container fluid >
        <
        Button color = "link" > < Link to = "/Product" > Manage Product < /Link></Button >
        <
        /Container> < /
        div >
    );
}

export default Home;
